<div class="entities" style="line-height: 2.5; direction: ltr">Modulation of antipsychotic-induced extrapyramidal side effects by medications for mood disorders . Antipsychotic drugs are widely used not only for schizophrenia , but also for mood disorders such as bipolar disorder and depression . To evaluate the interactions between antipsychotics and drugs for mood disorders in modulating extrapyramidal side effects ( EPS ) , we examined the effects of antidepressants and mood-stabilizing drugs on haloperidol ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42357
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) - induced bradykinesia and catalepsy in mice and rats . The selective serotonin reuptake inhibitors ( SSRIs ) , fluoxetine and paroxetine , and the tricyclic antidepressant ( TCA ) clomipramine , which showed no EPS by themselves , significantly potentiated 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42357
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - induced bradykinesia and catalepsy in a dose-dependent manner . In contrast , the noradrenergic and specific serotonergic antidepressant ( NaSSA ) mirtazapine failed to augment , but rather attenuated 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42357

 - induced bradykinesia and catalepsy .

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01236
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 influence on cytosol and nuclear androgen receptors in the ventral , dorsal , and lateral lobes of the rat prostate . PRL augments testosterone-mediated growth of the prostate in a permissive manner . To elucidate the mechanism of this hormonal interaction , the present study examined the effect of PRL on cytosol and nuclear androgen receptors in the three prostate lobes . Adult male Sprague-Dawley rats were castrated , given 5 - mm Silastic implants of testosterone , and either grafted with two anterior pituitary glands under the kidney capsule or sham operated . Three weeks later , animals were killed , serum was collected for PRL and testosterone RIA , and the ventral , dorsal , and lateral prostate lobes were processed for either cytosol or nuclear androgen receptor quantitation . Pituitary grafts significantly elevated the serum PRL concentration and increased the weight and the content of protein and DNA of the lateral prostate lobe compared to control values . There was no effect on these parameters in the ventral or dorsal lobes . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10275
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 levels and apparent distributions were different in the ventral , dorsal , and lateral lobes of control animals . Unoccupied and total cytosolic androgen receptors in the three separate prostate lobes were not significantly affected by the presence of the grafts . However , an elevated PRL concentration was associated with an increase ( P less than 0.005 ) in nuclear androgen receptor content in the lateral lobe exclusively . The binding affinity was not altered by pituitary grafts in any of the lobes . These findings suggest that PRL promotes lateral prostatic growth by increasing nuclear androgen receptor levels in that tissue and , thus , optimizes its response to circulating testosterone .</div>

 gene and a Bsp 1286I RFLP of the

 gene . Without correction for multiple testing , we found a significantly increased allele frequency of a common

<div class="entities" style="line-height: 2.5; direction: ltr">Vitamin D analogues . The plethora of actions attributed to 1,25 ( OH ) 2D3 throughout the body have suggested potential therapeutic applications for the treatment of hyperproliferative diseases , immune dysfunction , endocrine disorders , and metabolic bone disease . However , the potent calcemic activity of the natural vitamin D hormone has precluded its use in most cases . New vitamin D analogues are under development that display greater specificity , in most cases , by retaining the therapeutic properties of 1,25 ( OH ) 2D3 , but with lower calcemic activity . Two analogues have been approved for use in patients : calcipotriol ( DB02300 from Leo Pharmaceuticals , Copenhagen , Denmark ) for the treatment of psoriasis ; and 19 - nor -1,25 ( OH ) 2D2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 from Abbott Laboratories , Abbott Park , IL ) for secondary hyperparathyroidism . Many others analogues are currently being tested in preclinical and clinical trials for the treatment of various types of cancer and osteoporosis , and for immunosuppression . The selectivity of the analogues can be attributed to the combined interactions with four proteins : the vitamin D receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) , the serum vitamin D binding protein ( DBP ) , the vitamin D - 24 - hydroxylase and to a newly described membrane receptor . Low DBP affinity has been shown to be responsible for the reduced calcemic actions of calcipotriol and 22 - oxacalcitriol ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) , which is being tested for secondary hyperparathyroidism . However , the low calcemic activity of other analogues , including 19 - nor -1,25 ( OH ) 2D2 , involves other , as yet undefined , mechanisms . Understanding of the molecular basis for the selectivity of the vitamin D analogues will allow the design of more effective and safer vitamin D compounds for the treatment of a wide range of clinical disorders .</div>

<h2 style="margin: 0">10</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Dopamine receptors and psychiatric drug treatment . The established antipsychotic drugs act mainly by antagonizing dopamine mediated synaptic transmission in the brain . Increase in the rate of production of dopamine metabolites as well as the firing rate of dopamine-containing neurons can be interpreted as compensatory responses to an interruption of synaptic transmission at dopamine nerve terminals . The demonstration of involvement of limbic and cortical mechanisms in the antipsychotic activity of neuroleptic drugs is far more difficult than the involvement of nigro-striatal and tubero-infundibular mechanisms in the neurological and neuroendocrine effects of these drugs . Application of radioreceptor techniques to dopamine research has supported the findings obtained by other neuropsychopharmacological research techniques , providing more direct evidence of dopamine receptor blockade by neuroleptic drugs . Further research is needed especially in studying the nature of the time-dependent adaptive changes at the receptor sites as well as the differences between the different dopamine projections and neural systems in the brain . The different subtypes of dopamine receptors in the brain , currently called D1 and D2 dopamine receptors , seem to be parallel , although in many respects independently-acting regulatory systems . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - selective antagonists such as sulpiride seem to cause selective D2 receptor up-regulation . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01236

</mark>
 secretion seems to be regulated by D2 dopamine receptors . The exact physiological role of D1 dopamine receptors as well as the clinical consequences of selective D1 antagonism is not known . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00391

</mark>
 and clozapine are examples of atypical neuroleptic compounds that have quite different profile of action , the former having strong and selective antidopaminergic action , the latter combining a number of non - dopaminergic mechanisms with rather slight effects on dopamine receptors . ( ABSTRACT TRUNCATED AT 250 WORDS )</div>

<h2 style="margin: 0">11</h2>

 ) . Immunocytochemical analyses confirmed the presence of

 in human spermatozoa and localized this receptor to the postacrosomal region of the sperm head as well as the neck , midpiece , and principal piece of the sperm tail . Nested PCR analysis indicated that these cells possess four splice variants of the

 kinase activation and phosphotyrosine expression , two hallmarks of this process . The suppression of sperm capacitation was accompanied by a powerful prosurvival effect , supporting the prolonged motility of these cells and preventing the formation of spontaneous DNA strand breaks via mechanisms that involved the concomitant suppression of caspase activation . Western blot analyses indicated that the prosurvival effect of PRL on human spermatozoa involved the stimulation of Akt phosphorylation , whereas inhibitors of phosphatidylinositol - 3 - OH kinase and Akt negated this effect , as did the direct induction of sperm capacitation with DB02527 analogues . We conclude that PRL is a prosurvival factor for human spermatozoa that prevents these cells from defaulting to an intrinsic apoptotic pathway associated with cell senescence . These findings have implications for preservation of sperm integrity in vivo and in vitro .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Evaluation of the endogenous cannabinoid system in mediating the behavioral effects of dipyrone ( metamizol ) in mice .

<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 is a sulpiride isomer that exerts its prokinetic action through a dual mechanism : 1 ) as a 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
